import React from 'react'
import { HeaderSecretariaDC, ClienParticular, ClienCorporativo } from '../../Components'
import Button from 'react-bootstrap/Button'
import Link from 'react-router-dom'
import Container from 'react-bootstrap/Container';

class Clientes extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
          showComponent: false,
        };
        this._onButtonClick = this._onButtonClick.bind(this);
      }    
      _onButtonClick() {
        this.setState({
          showComponent: true,
        });
      }
    
    render(){
    return (
        <>
            <HeaderSecretariaDC />
            <Button onClick={this._onButtonClick} variant="primary">Primary</Button>{this.state.showComponent ? <ClienParticular /> :null}
            <Container className="mr-50 ml-50">
            <h2> Nuevo Cliente Particular </h2>
            {/* <ClienParticular /> */}
            <h2> Nuevo Cliente Corporativo </h2>
            <ClienCorporativo />
            </Container>
        </>
    )
}}

export default Clientes
